import myImage from '../다운로드.png';
import profileImage from '../image_readtop_2023_212013_16790370025393270.jpeg';



const ReviewItem = () => {
    return <div className = "ReviewItem" >  
        <div className="food_image">
            <img src= {myImage} />
        </div>
        <div className="profile_image">
            <img src= {profileImage} />
        </div>

    </div>;
};

export default ReviewItem;
